pragma solidity ^0.8.18;

import "@openzeppelin/contracts/proxy/Clones.sol";

contract Platform{
    address contract_creator;
    address template_address;
    address[] admin;
    address[] running_project;
    uint256 contract_id = 0;


    constructor (address template) {
        template_address = template;
        contract_creator = msg.sender;
        admin.push(msg.sender);
    }

    function test() external view returns (address){
        return template_address;
    }

    function createProject(string memory projectName, uint256 no_of_date) external returns (uint256, address){
        address project = Clones.cloneDeterministic(template_address, bytes32(contract_id));
        running_project.push(project);
        contract_id += 1;
        //project.call{gas: 5000}(abi.encodeWithSignature("init(address, string, uint256)", msg.sender, projectName, 86400 * no_of_date));
        //projectInterface(project).init(msg.sender, projectName, 86400 * no_of_date);
        return (contract_id - 1, project);
    }

}

